import styles from "./Header.module.css"
import Boton from "../Boton"
import logo from "./Logo.png"



function Header() {

    function home(e) {
        e.preventDefault();
        window.location.href = 'https://google.com'
    }

    function form(e) {
        e.preventDefault();
        window.location.href = 'https://google.com'
    }


    return (
        <>
            <div className={styles.header}>
                <img src={logo} alt="Logo Alura Flix" />
                <nav>
                    <Boton className={styles.botonH} onClick={e=>home(e)}
                    >HOME</Boton>
                    <Boton className={styles.botonN} onClick={e =>form(e) }
                    >NUEVO VIDEO</Boton> 
                </nav>
            </div>
            
        </>
    )

}

export default Header
